Телефо́нный пла́н нумера́ции — система, позволяющая пользователям телефонов совершать и принимать междугородные и международные телефонные звонки. Код зоны нумерации (называемый ABC для географически определяемой зоны нумерации или DEF — для географически не определяемой зоны нумерации) — 3 десятичных знака для Российской Федерации — та часть телефонного номера, которая указывает междугородный узел связи. Телефонными планами нумерации коды зон присваиваются междугородным узлам связи, так что звонящий абонент может связаться с телефонами за пределами своего местного узла связи. Обычно код зоны, находящийся перед номером, соответствует определённому географическому местоположению. Различают открытые и закрытые планы нумерации. При открытом плане нумерации местное телефонное соединение устанавливается набором только местного номера без набора национального номера. При закрытом плане нумерации набор национального номера необходим для телефонного соединения любого вида — местного, внутризонового, междугороднего. Международный союз электросвязи отдаёт предпочтение закрытому плану нумерации. В соответствии с приказом Мининформсвязи, в 2008 году Россия должна была полностью перейти на закрытый план нумерации. Однако по состоянию на 20 августа 2013 года закрытый план нумерации был введён только в Москве. Абонентам, совершающим звонки внутри своей зоны (например, абонентам в своём же городе), обычно не требуется набирать код зоны. В международных телефонных номерах код зоны следует непосредственно за международным телефонным кодом страны. Хотя Международный союз электросвязи (ITU) пытается сделать так, чтобы по всему миру были внедрены единые стандарты доступа к международной и междугородной связи, до сих пор в разных странах существуют различные способы доступа к внезоновым звонкам. Например, ITU рекомендует, чтобы для международного доступа использовался код 00. Однако эти рекомендации действуют не во всех государствах. Например, США и Канада используют Североамериканский план нумерации со своими правилами. Россия так же использует свой способ доступа (через «восьмёрку»). Международный план нумерации устанавливает телефонные коды стран, то есть коды, определяющие целые страны или группы стран. Стандарт E.164 регулирует телефонные коды стран на международном уровне и устанавливает максимальную длину полного международного телефонного номера. Каждая страна сама устанавливает нумерацию внутри своей телефонной сети. В результате, региональные коды зон могут иметь: 
*  фиксированную длину, например, 3 цифры в США, Канаде, России, 1 цифру в Австралии; 
*  переменную длину, например, от 2 до 5 цифр в Германии и Австрии, от 1 до 3 цифр в Японии, 1 или 2 цифры в Израиле; 
*  либо могут быть включены прямо в номер абонента, как, например, в Испании или Норвегии — это называется «закрытый» план нумерации. В некоторых случаях необходимо всегда набирать и код выхода на междугородную станцию (в Европе обычно 0): так происходит в Бельгии, Швейцарии, ЮАР. Обычно коды зон определяют и стоимость звонка. Звонки внутри своей зоны или небольшой группы соседних или перекрывающих друг друга зон стоят намного меньше звонков за пределы такой зоны или группы зон. Кроме того, существуют специальные коды зон для бесплатных и платных звонков, для звонков в сотовые сети связи. Существуют также исключения: в некоторых странах (например, в Израиле) звонки тарифицируются по одной стоимости независимо от того, куда звонит абонент, а в других (например, в Великобритании) код зоны обычно делится на две части с разной стоимостью.
